MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "The EDA Bridge application window of Simcenter Flotherm software models printed circuit boards in detail, and should be used when a PCB is on the critical heat transfer path.");
MGCAddSnippet(5, "Use EDA Bridge to create detailed representations of Printed Circuit Boards (PCBs) and to interface with Electronic Design Automation (EDA) products.");
MGCAddSnippet(6, "The Simcenter Flotherm SmartParts that can be used to model PCBs and their components are PCB SmartParts, Component SmartParts and Compact Component SmartParts. Descriptions of their applicability are given here.");
MGCAddSnippet(7, "A high-level procedure to give an overview of the process. You create the MotherBoard in EDA Bridge (either manually, or using file import) and then transfer it to Simcenter Flotherm.");
MGCAddSnippet(8, "This section describes the main features of the EDA Bridge application window.");
MGCAddSnippet(9, "The EDA Bridge window is divided into two main areas: a hierarchical tree and a display area that shows 2D or 3D views.");
MGCAddSnippet(10, "The EDA Bridge window displays the board layout and a data tree.");
MGCAddSnippet(11, "The data tree (Tree View tab) shows the constituent parts of the board in a hierarchical order of parent, child, and grandchild.");
MGCAddSnippet(12, "If components are present, a table of the component properties can be displayed (Component Table tab).");
MGCAddSnippet(13, "The display area provides 2D or 3D views of the physical model.");
MGCAddSnippet(14, "When you select an object when the tree view is shown, then the property sheet for the object is displayed beneath the data tree.");
MGCAddSnippet(15, "The toolbars can be moved and either left floating or docked along the top, bottom, left side or right side of the window. Hover text describes each toolbar icon.");
MGCAddSnippet(16, "Context-sensitive (right-click) menus are available for geometry editing functions and for editing the library and loading library items.");
MGCAddSnippet(17, "Key combinations for menu options, also known as hotkeys.");
MGCAddSnippet(18, "How to manage EDA Bridge projects.");
MGCAddSnippet(19, "Each board design study is encapsulated within a unique EDA Bridge project.");
MGCAddSnippet(20, "To work on a EDA Bridge project, you either create a new project or load an existing one.");
MGCAddSnippet(21, "Advanced users can run a FloSCRIPT file from EDA Bridge.");
MGCAddSnippet(22, "This section describes general project tasks including setting user preferences.");
MGCAddSnippet(23, "A new project clears the current project from the window and includes a new MotherBoard.");
MGCAddSnippet(24, "You can set the default units used by the EDA Bridge window and dialog boxes.");
MGCAddSnippet(25, "You can set your preferences for the appearance of the EDA Bridge window.");
MGCAddSnippet(26, "Changing the default mouse buttons that control pan, zoom, and rotate when viewing 3D images.");
MGCAddSnippet(27, "It is recommended that you save the project regularly.");
MGCAddSnippet(28, "This section describes the dialog boxes used when managing projects.");
MGCAddSnippet(29, "Use this dialog box to set the default units in the window and dialog boxes.");
MGCAddSnippet(30, "Use this dialog box to set preferences and to customize the appearance of the EDA Bridge window. The settings are remembered (and will be retained until you change them) for future sessions of EDA Bridge.");
MGCAddSnippet(31, "Use this dialog box to assign which mouse buttons control the 3D view.");
MGCAddSnippet(32, "Use this dialog box to overwrite or version increment an existing project and add modeling notes. The dialog box consists of an editable text panel containing the project notes and any incremental history.");
MGCAddSnippet(33, "How to display and build the representation of the physical board layout.");
MGCAddSnippet(34, "Reference Designators are used to identify components.");
MGCAddSnippet(35, "By default, the MotherBoard is drawn over the X-Y plane with the origin in the left bottom corner as indicated above.");
MGCAddSnippet(36, "The graphics display area shows 2D or 3D views of the physical shape of the board.");
MGCAddSnippet(37, "The default view of the board is from the top, but there are also options to view from the bottom, front, or side.");
MGCAddSnippet(38, "Components or functional groups can be highlighted in the data tree and display area.");
MGCAddSnippet(39, "By default, the components on a board are colored gray, however, they can be shown in outline (that is, as wireframe) or colored.");
MGCAddSnippet(40, "The components can be annotated in the display area to show their name, size, power, height, and construction notes.");
MGCAddSnippet(41, "Component notes can be displayed over components in the display area.");
MGCAddSnippet(42, "You can add geometry to MotherBoards, DaughterBoards, and rectangular components. The geometry types that you can add depends on the parent object selected. ");
MGCAddSnippet(43, "The New Geometry toolbar contains icons for adding new geometry to the model.");
MGCAddSnippet(44, "New objects can be added to a parent object by using the context-sensitive menus.");
MGCAddSnippet(45, "The library is a resource of components that can be added to a PCB.");
MGCAddSnippet(46, "A EDA Bridge object can be swapped for an object of the same type in the library using the library pane or popup menu.");
MGCAddSnippet(47, "Copies of existing components on the board can be made using copy and paste or by Ctrl+dragging. ");
MGCAddSnippet(48, "Cloning components across the board in two dimensions.");
MGCAddSnippet(49, "Basic object location changes can be made in the 2D display area by dragging, nudging, and aligning, but for more detailed construction changes use the component property sheets and component tables.");
MGCAddSnippet(50, "You can use a mouse, arrow keys or dialog box.");
MGCAddSnippet(51, "Using the mouse to resize an object.");
MGCAddSnippet(52, "Use the distance measurement tool to display the distance between two selected objects.");
MGCAddSnippet(53, "Components can be repositioned to align with other components or have equal distances between them.");
MGCAddSnippet(54, "General usage advice applicable to all property sheets.");
MGCAddSnippet(55, "Component details can be displayed and edited in the Component Tables.");
MGCAddSnippet(56, "In property sheets, the dropdown list of materials can be expanded to include materials in the Simcenter Flotherm library.");
MGCAddSnippet(57, "If the materials selection list needs tidying, you can remove options no longer required.");
MGCAddSnippet(58, "The properties of a selected material can be displayed in the View Existing Material Data dialog box.");
MGCAddSnippet(59, "Notes can be attached to individual components for reference or identification purposes.");
MGCAddSnippet(60, "This section describes how to import board designs that are in other formats.");
MGCAddSnippet(61, "Import of designs exported from any of the supplied direct EDA interfaces.");
MGCAddSnippet(62, "Board designs available in the data exchange format, ODB++, can be imported");
MGCAddSnippet(63, "Board designs available in the IDF format can be imported into EDA Bridge. ");
MGCAddSnippet(64, "The Components CSV file offers an alternative method of integration between EDA tools and EDA Bridge if IDF export is not available in the EDA tool.");
MGCAddSnippet(65, "Often, power information changes frequently throughout the board design process. Importing a power list in CSV format enables you to update a number of component power values at the same time.");
MGCAddSnippet(66, "When importing new power values you can generate an Import Power List Report.");
MGCAddSnippet(67, "The primary purpose of EDA Bridge is to design then transfer a board design to Simcenter Flotherm for solving. Board designs can also be exported in FLOPLC and IDF file formats. During the design process, component data including power, or only component power, can be exported in CSV file format.");
MGCAddSnippet(68, "To solve the model, it must be transferred to EDA Bridge.");
MGCAddSnippet(69, "You can export a *.floplc file containing the placement, component power dissipation and thermal data that can be read by supplied direct interface tools.");
MGCAddSnippet(70, "You can export the board design in the IDF format files (*.emn and *.emp) that can be read by EDA software.");
MGCAddSnippet(71, "You can export board design information in comma separated variable files.");
MGCAddSnippet(72, "You can export the list of power values. Typically you will export a power list to modify a number of power values and then import those new values back into the design.");
MGCAddSnippet(73, "Heat dissipated from components is modeled either discretely, restricting heat output to the component location, or smeared over the board.");
MGCAddSnippet(74, "Filtering of components is useful when there are many low powered components on the board.");
MGCAddSnippet(75, "Filtered-out components can be made visible by changing the default method of coloring components.");
MGCAddSnippet(76, "Components and Cylinders can be temporarily removed from the model by deactivating them.");
MGCAddSnippet(77, "Simcenter Flotherm libraries contain items that can be copied into EDA Bridge, allowing more detailed component thermal models to be used. In addition, objects created in EDA Bridge can be saved to a library.");
MGCAddSnippet(78, "Libraries are listed hierarchically in the Library pane.");
MGCAddSnippet(79, "A simple method for adding components from a library to a motherboard.");
MGCAddSnippet(80, "One or more components can be swapped for a component in the library by selection.");
MGCAddSnippet(81, "You can replace components with library items, based on the Package Names of the components. This process is built into the importing of IDF or FLOEDA files.");
MGCAddSnippet(82, "An entire library can be exported to the file system for subsequent distribution to other EDA Bridge installations.");
MGCAddSnippet(83, "Library items in Mentor Graphics Mechanical Analysis PDML can be added to a library.");
MGCAddSnippet(84, "EDA Bridge board geometry can be copied to the Simcenter Flotherm library,");
MGCAddSnippet(85, "In addition to the delivered libraries, you can create new libraries.");
MGCAddSnippet(86, "Search options include partial-matching and case-sensitivity.");
MGCAddSnippet(87, "A quick way of downloading a library item to a selected project part, without the need to expand the library.");
MGCAddSnippet(88, "When a library item has been found by a library search, the item can be selected in the library hierarchy tree then added to the project.");
MGCAddSnippet(89, "Power lists and components defined by CSV files.");
MGCAddSnippet(90, "Use this file to add power values to components by file import as an alternative to manually adding data directly into property sheets.");
MGCAddSnippet(91, "Use this file to view or use component data in spreadsheet format, or to import component data to a model.");
MGCAddSnippet(92, "Dialog boxes available when laying out a board design.");
MGCAddSnippet(93, "Use this dialog box to browse and select library items suitable for addition to the EDA Bridge model.");
MGCAddSnippet(94, "Use this dialog box to create a two dimensional matrix array pattern of a single geometry object.");
MGCAddSnippet(95, "Use this dialog box to specify precise movement of the selected object(s).");
MGCAddSnippet(96, "Use this dialog box to find and select either components or functional groups of components. When found, the objects become highlighted in the display.");
MGCAddSnippet(97, "Use this dialog box to add or delete materials from the materials selection list.");
MGCAddSnippet(98, "Use this dialog box to view the properties of a selected material.");
MGCAddSnippet(99, "Use this dialog box to create component construction notes that can be displayed in the property sheets and the display area.");
MGCAddSnippet(100, "Use this dialog box to select libraries to be searched for cross-reference links when importing components, allowing more detailed component thermal models to be imported in conjunction with the library data.");
MGCAddSnippet(101, "Use this dialog box to select which project information is to be included in an exported CSV file.");
MGCAddSnippet(102, "Use this dialog box to determine the heat dissipation model for the components or just to simplify the model.");
MGCAddSnippet(103, "Use this dialog box to select a library folder to hold the exported geometry to the Simcenter Flotherm library. This geometry can then be accessed from Simcenter Flotherm and used for system analysis.");
MGCAddSnippet(104, "Use this dialog box to add a folder to the Simcenter Flotherm library. Geometry may then be added to or copied from this directory using the library manager.");
MGCAddSnippet(105, "Use this dialog box to quickly find and select items in a library according to an entered search criteria.");
MGCAddSnippet(106, "Use this dialog box to choose to update or replace an existing EDA Bridge model.");
MGCAddSnippet(107, "A set of modeling objects is provided from which you can add instances of objects to your board.");
MGCAddSnippet(108, "Selecting an item in the node tree or the graphical 2D view results in valid geometry icons in the New Geometry toolbar becoming active.");
MGCAddSnippet(109, "All EDA Bridge projects have a MotherBoard, which is the root object onto which you add objects.");
MGCAddSnippet(110, "DaughterBoards represent mezzanine boards, mounted in parallel with, or perpendicular to, the MotherBoard.");
MGCAddSnippet(111, "Use to define layer properties of a board.");
MGCAddSnippet(112, "A group of four layers are provided by default with the Motherboard or a new Daughterboard. More layers can be added.");
MGCAddSnippet(113, "The layer definition for a board can be saved to, and retrieved from, a library. ");
MGCAddSnippet(114, "Use Layer Patches to define regions within a layer that have a different coverage of copper compared with the rest of the layer.");
MGCAddSnippet(115, "An example of Layer Patch usage is close to a high pin count package where there is a high density of signal tracks.");
MGCAddSnippet(116, "Use the Layer Patch property sheet to define a layer patch on a metallic layer.");
MGCAddSnippet(117, "Monochrome images of PCBs, detailing copper and insulators in black and white respectively, can be used to quickly set-up representative layer patches. Using one of the supplied direct EDA interfaces will enable import of all board data, including image representation for each layer.");
MGCAddSnippet(118, "Use Electrical Vias to model the thermal effects of heat transfer down through the board when through-hole vias are present.");
MGCAddSnippet(119, "Areas containing electrical vias can be individually specified in terms of number and average diameter, and so on, or according to percentage coverage in that area.");
MGCAddSnippet(120, "Use the Electrical Via property sheet to define vias manually or automatically.");
MGCAddSnippet(121, "An image file can be used to create a complex distribution of electrical vias.");
MGCAddSnippet(122, "Image files of PCB dielectric layers can be used to create a complex distribution of electrical vias.");
MGCAddSnippet(123, "The definition requirements of a rectangular component depends on the component type and how it was produced.");
MGCAddSnippet(124, "Cylindrical Components are typically used to represent capacitors.");
MGCAddSnippet(125, "Use Functional Groups to manipulate related groups of components.");
MGCAddSnippet(126, "Functional Groups are useful for moving and rotating groups of components.");
MGCAddSnippet(127, "You can create an empty functional group, or a functional group of existing components.");
MGCAddSnippet(128, "Use Rectangular Cutouts to create rectangular holes in boards, thereby creating irregular shaped boards.");
MGCAddSnippet(129, "Heatsinks can have plates or pins. Pins can be inline or staggered.");
MGCAddSnippet(130, "Although a thermal via represents an array of thermal vias, it is modeled as a single block with an averaged conductivity.");
MGCAddSnippet(131, "Use the Can object to model an EM can (RF shield).");
MGCAddSnippet(132, "Potting compounds represent the material applied to seal components on a board. They can be placed over all or part of either side of the board. Multiple non-overlapping potting compounds are allowed.");
MGCAddSnippet(133, "Placement keepout regions are location tools only, used to warn when components are positioned within specific locations on the MotherBoard or DaughterBoards.");
MGCAddSnippet(134, "The following property sheets and dialog boxes are associated with the modeling objects.");
MGCAddSnippet(135, "Use this property sheet to define the size, rotation, and material of the motherboard.");
MGCAddSnippet(136, "Use this property sheet to define the size, rotation, standoff, and material of a daughterboard.");
MGCAddSnippet(137, "Use this property sheet to specify an equispaced group of layers or to define the layer offset distances from the top of the board.");
MGCAddSnippet(138, "Use this property sheet to define the properties of a PCB layer.");
MGCAddSnippet(139, "Use this property sheet to define the size, position, and percentage copper coverage of a layer patch.");
MGCAddSnippet(140, "Use this property sheet to define the plating and fill materials of an electrical via assembly, and to reference an image file.");
MGCAddSnippet(141, "Use this property sheet to define the area and location of a group of electrical vias, with the option to specify the number and average diameter (manual) or a percentage coverage (automatic).");
MGCAddSnippet(142, "Use this property sheet to define a component and its position on the board.");
MGCAddSnippet(143, "Use this property sheet to define the size, location, and material of a cylindrical component or capacitor.");
MGCAddSnippet(144, "Use this property sheet to define the identifier, total power, location, and size of a functional group.");
MGCAddSnippet(145, "Use this property sheet to define the location and size of a rectangular cutout in the board.");
MGCAddSnippet(146, "Use this property sheet to define the dimensions and configuration of a heatsink.");
MGCAddSnippet(147, "Use this property sheet to define a staggered or unstaggered array of PCB thermal vias.");
MGCAddSnippet(148, "Use this property sheet to define the location, size, and material of a Can.");
MGCAddSnippet(149, "Use this property sheet to define the location, size, and material of potting compound.");
MGCAddSnippet(150, "Use this property sheet to define the size and location of an area on the board where components should not be located (placement keepout region).");
MGCAddSnippet(151, "Use this dialog box to adjust the representation of the layer patches to be generated.");
MGCAddSnippet(152, "Use this dialog box to adjust the number of vias to be generated. ");
MGCAddSnippet(153, "Use this dialog box to adjust the representation of the electrical vias.");
MGCAddSnippet(154, "Answers for frequently asked questions (FAQs) about EDA Bridge.");
MGCAddSnippet(155, "Answers to questions about board layout and definition.");
MGCAddSnippet(156, "Answers to questions about components.");
MGCAddSnippet(157, "Answers to questions about layers.");
MGCAddSnippet(158, "Answers to questions about solving.");
MGCAddSnippet(159, "Answers to questions about transfers to Simcenter Flotherm.");

